package array

import (
	"testing"
)

//判断子序列
func isSubsequence(s string, t string) bool {
	if len(s) == 0 {
		return true
	} else if len(t) == 0 || len(t) < len(s) {
		return false
	}
	i, j := 0, 0
	for i <= len(s)-1 && j <= len(t)-1 {
		if j <= len(t)-1 {
			if s[i] == t[j] {
				i++
				j++
			} else {
				j++
			}
		} else {
			break
		}
	}
	return i == len(s)
}

func Test_392(t *testing.T) {
	t.Log(isSubsequence("leeeeetcode", ""))
	t.Log(isSubsequence("", "ahbgdc"))
	t.Log(isSubsequence("abc", "ahbgdc"))
	t.Log(isSubsequence("axc", "ahbgdc"))
}
